import React from 'react';
import '../src/components/Header.css';
import Header from './components/Header';
import img1 from './components/001.jpg';

import img2 from './components/002.jpg';
import img3 from './components/003.jpg';
import img4 from './components/004.jpg';
import img5 from './components/005.jpg';
import img6 from './components/006.jpg';
import './img.css'



function App() {
  return (
    <div className="App r">
      <Header />
      <div className="Content">
      <div data-slick='{"slidesToShow": 4, "slidesToScroll": 4}'>
      <div><h3>1</h3></div>
      <div><h3>2</h3></div>
      <div><h3>3</h3></div>
      <div><h3>4</h3></div>
      <div><h3>5</h3></div>
      <div><h3>6</h3></div>
</div>
        <p>42 is the answer to everything...</p>
      </div>
    </div>
  );
}

export default App;
